// Navbar.js
import React from 'react';

function Navbar() {
  return (
    <nav style={{ backgroundColor: 'black', color: 'white' }}>
      <ul style={{ listStyleType: 'none', padding: 0, margin: 0 }}>
        <li style={{ display: 'inline', marginRight: '10px' }}><a href="#">Home</a></li>
        <li style={{ display: 'inline', marginRight: '10px' }}><a href="#">About</a></li>
        <li style={{ display: 'inline', marginRight: '10px' }}><a href="#">Services</a></li>
        <li style={{ display: 'inline' }}><a href="#">Contact</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
